package com.kuaixiu.activity.entity;import com.common.base.entity.BaseEntity;/** * . * * @CreateDate: 2018-12-28 下午05:06:44 * @version: V 1.0 */public class ActivityProject extends BaseEntity {        /**     * 序列化Id     */    private static final long serialVersionUID = 1L;    /**     *      */    private String id ;    /**     * 活动类型 1：快修 2电信     */    private Integer type ;    /**     * 项目编号     */    private String projectNo ;    /**     * 活动项目名字     */    private String projectName ;    /**     * get:     */    public String getId(){        return this.id;    }    /**     * set：     */    public void setId(String id){        this.id=id;    }    /**     * get:活动类型 1：快修 2电信     */    public Integer getType(){        return this.type;    }    /**     * set：活动类型 1：快修 2电信     */    public void setType(Integer type){        this.type=type;    }    /**     * get:项目编号     */    public String getProjectNo(){        return this.projectNo;    }    /**     * set：项目编号     */    public void setProjectNo(String projectNo){        this.projectNo=projectNo;    }    /**     * get:活动项目名字     */    public String getProjectName(){        return this.projectName;    }    /**     * set：活动项目名字     */    public void setProjectName(String projectName){        this.projectName=projectName;    }}